/*Table structure for table `batch_pay_his` */

DROP TABLE IF EXISTS `batch_pay_his`;

CREATE TABLE `batch_pay_his` (
  `pay_his_id` bigint(20) NOT NULL,
  `user_work_id` bigint(20) NOT NULL COMMENT '用户工作关系id',
  `batch_no` varchar(16) NOT NULL COMMENT '支付批次',
  `seq` varchar(20) DEFAULT NULL COMMENT '支付序号',
  `money` varchar(128) NOT NULL COMMENT '支付金额',
  `state` varchar(20) NOT NULL COMMENT '支付状态，paying 支付中,success 支付成功,fail 支付失败',
  `REMARK` varchar(1024) DEFAULT NULL COMMENT '支付结果，当state=fail时有效',
  `create_date` datetime NOT NULL,
  `update_date` datetime DEFAULT NULL,
  `dest_alipay_no` varchar(256) DEFAULT NULL COMMENT '接收支付宝帐号',
  `dest_alipay_name` varchar(256) DEFAULT NULL COMMENT '接收支付宝户名',
  `alipay_batch_no` varchar(16) DEFAULT NULL COMMENT '调用支付宝接口时的批次号',
  PRIMARY KEY (`pay_his_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

