/*Table structure for table `order_item` */

DROP TABLE IF EXISTS `order_item`;

CREATE TABLE `order_item` (
  `ITEM_ID` bigint(20) NOT NULL,
  `ORDER_ID` varchar(256) DEFAULT NULL,
  `ITEM_TYPE` varchar(20) DEFAULT NULL COMMENT 'cancel取消\n            payment付款成功\n            complete完成\n            booking预约\n            signin签到\n            siginout签退\n            pointsend积分发放\n            rebate余额返还，返利\n            charge扣除佣金\n            refund退款',
  `CREATE_DATE` datetime DEFAULT NULL,
  `ITEM_CONTENT` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`ITEM_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单项';

/*Data for the table `order_item` */

/*Table structure for table `order_pay_his` */

DROP TABLE IF EXISTS `order_pay_his`;

CREATE TABLE `order_pay_his` (
  `PAYHIS_ID` bigint(20) NOT NULL,
  `ITEM_ID` bigint(20) DEFAULT NULL,
  `PAY_TYPE` varchar(20) DEFAULT NULL COMMENT 'balance余额支付\n            alipay支付宝转帐\n            point积分支付\n            coupon优惠券',
  `PAY_VALUE` float DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL,
  PRIMARY KEY (`PAYHIS_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单付款记录';

/*Data for the table `order_pay_his` */

/*Table structure for table `order_prod` */

DROP TABLE IF EXISTS `order_prod`;

CREATE TABLE `order_prod` (
  `ORDER_PROD_ID` bigint(20) NOT NULL,
  `ORDER_ID` varchar(256) DEFAULT NULL,
  `PROD_ID` bigint(20) DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL,
  PRIMARY KEY (`ORDER_PROD_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单内产品';

/*Data for the table `order_prod` */

/*Table structure for table `prod` */

DROP TABLE IF EXISTS `prod`;

CREATE TABLE `prod` (
  `PROD_ID` bigint(20) NOT NULL,
  `USER_ID` bigint(20) DEFAULT NULL,
  `PROD_TYPE` varchar(20) DEFAULT NULL,
  `EFF_DATE` date DEFAULT NULL,
  `EXP_DATE` date DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL,
  `PROD_NAME` varchar(256) DEFAULT NULL,
  `CONTENT` text,
  `CITY_ID` varchar(20) DEFAULT NULL COMMENT '所在城市',
  `ASSESSMENT` bigint(20) DEFAULT NULL COMMENT '评价分数',
  PRIMARY KEY (`PROD_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户产品';

