人员可与本公司联系！展示你的才艺，展示你的天份，这里的发展空间无极限，公司会为你打造一个良好的发展平台','jsnanjing',NULL),(273,3428,'partTime','2015-10-30','2015-11-30','2015-10-28 10:23:18','人偶发单员','工作内容人偶发传单员：\n任职要求：净身高160（含）以上，男女均可，能吃苦耐劳。工作主要负责发放与公司有关的宣传单页或礼品，吸引人流休息到本公司的活动，达到宣传效果。（学生优先，需带学生证。）\n工作时间：上午9:30—11:30，下午3:00—7:00\n薪酬待遇：160元/天，提供午餐。\n公司提供的人偶工作服不予损坏，人为损坏需视情况赔偿。\n','jsnanjing',NULL),(274,3428,'partTime','2015-10-28','2016-05-31','2015-10-28 10:46:46','软件推广员','工作内容\n软件推广员：\n工作内容：负责 公司网站APP宣传工作，并向客户解释相关问题，让客户扫公司网站二维码注册，关注微信即可，并向客户赠送礼品。\n工作地点：南京各大高校校园周边\n任职要求：大专以上学历，认真、有责任心、开朗、执行力强，能较好的与人沟通，形象好气质佳优先考虑，有经验者优先考虑。\n薪金待遇：110元/天 底薪+提成\n工作时间：每周六、日上午11:00-下午8:00,中间有一小时休息时间。\n','jsnanjing',NULL),(275,3429,'partTime','2015-10-28','2016-10-28','2015-10-28 15:07:53','家教','工作内容：\n岗位职责：聘大专以上家教或实习生，每周一至周五下午负责辅导小学1-6年学生家庭作业正确完成和完学校交负临时性工作仼务。\n任职资格：大专以上或在校实习生，有一定语言表达能力和勾通能力，喜欢教育事业和孩子，有工作责仼心和上进心。\n工作时间：上班时间每周一至周五正常为下午2点至晚8点，每周休两天。','jsnanjing',NULL),(276,3429,'partTime','2015-10-28','2016-10-28','2015-10-28 15:07:55','传单派发','工作内容：\n岗位职责：1 在学校门口派发单页，要有主动性、有责任心、不怕吃苦. \n2 善于沟通交际、性格开朗、语言表达清晰. 男女不限，大学生兼职亦可！ \n3 工作时间周一至周五下午有1到5小时的发单时间，可灵活安排。\n4 工资12元/小时，做的好加业绩提成，正式打卡日结。','jsnanjing',NULL),(277,3429,'partTime','2015-10-28','2016-10-28','2015-10-28 15:08:13','促销导购员','工作内容：\n成功签单有提成机制，对于和公司一起成长的员工，公司会有分红和职位提升等空间\n岗位职责:\n1、接待顾客,咨询,完成销售工作;\n2、熟练掌握在售商品的产品知识、服务礼仪\n3、做好每日店内的清洁、商品陈列等工作\n4、执行陈列商品的养护、清洁、防盗工作\n任职资格:\n1、有相关工作经验者优先;\n2、具有较强的沟通能力及服务意识,善于与人合作,吃苦耐劳;\n3、形象气质佳,身体健康;','jsnanjing',NULL),(278,3429,'partTime','2015-10-28','2016-10-28','2015-10-28 15:26:00','礼仪模特','工作内容\n礼仪模特\n任职资格：\n1、18-25岁，净身高168cm（含）以上（综合条件优异者可适当放宽），形象好，气质佳，\n   2、细心负责，沟通能力强，适应能力强；\n   3、有礼仪接待的相关工作者优先考虑；\n4、本职位仅限女生；\n岗位职责：主要是礼仪、车展、T台走秀、唱歌、舞蹈表演、演艺大厅的走秀、外景或平面拍摄等。\n工作时间：上午9:00—下午6:00，中间休息一小时\n薪资待遇：150--300/天\n公司长期直招优秀礼仪/模特/舞蹈/音乐等优秀人员,有需要长短期全职兼职的人员可与本公司联系！展示你的才艺，展示你的天份，这里的发展空间无极限，公司会为你打造一个良好的发展平台','jsnanjing',NULL),(279,3429,'partTime','2015-10-28','2016-10-28','2015-10-28 15:35:33','钟点工','岗位职责：\n1、负责所分配客户的家庭卫生清洁工作；\n2、负责家庭晚餐的制作\n3、听从分配和安排，按时完成工作任务。\n任职资格：\n1、女，身体健康，年龄30