格，有过拍摄经验者，优先录用。无经验者，公司有专业影视老师做免费培训。\nT台走秀模特\n身高165以上（综合条件优异者可适当放宽），形象好，身材高挑，外形甜美，性格外向，爱学习，沟通能力强，能轻松驾驭高跟鞋，公司提供礼服，旗袍，婚纱等一系列演出走秀服装（也可自带服装）。有T台走秀经验者，优先录用。无经验者，公司带薪培训，统一培训形体、动作以及台步。\n           薪资待遇：200-500/天\n3、舞蹈组：\n身高160以上，形象好，气质佳，穿着时尚，具有一定的舞蹈基础，以流行、爵士、现代舞为主，可做各种类型的电视晚会，以及演唱会班底。\n           薪资待遇：150-400/天\n职位介绍：\n以上所有职位白班为商演、婚庆、剪彩、礼仪、颁奖典礼以及车展、走秀、电视晚会明星同台等，时间不定期，对专业要求相对比较高，工资不限（视活动大小而定，在200-800之间不等，）完工结算，每月场次不限。\n而晚上为同样的正规舞台，唱歌表演，模特走秀，晚会形式，服装为各式样晚礼、旗袍、个性等，可以全（兼）职胜任，工资待遇整体相对比较高，一天在200-500之间，只是时间有点稍晚，一般在10点-1一点半左右。看个人对自己生活质量的要求而进一步选择。\n演艺舞台全职保底底薪在8000-15000/月，个人条件优秀，综合能力强的保底底薪在1万-3万/月。\n本公司全程舞台演出，而非KTV、酒吧，无需喝酒。欢迎来公司做实地考察，以及随时观看演出现场的一切软硬件设施。\n所有职位全（兼）职均可，兼职者一周任意四天以上（包括四天），全职者每月可自动调休4-5天。','jsnanjing',NULL),(317,3363,'partTime','2015-10-29','2015-11-02','2015-10-29 11:08:32','兼职美工','工作内容','jsnanjing',NULL),(318,3363,'partTime','2015-10-29','2015-11-29','2015-10-29 11:10:22','程序员','工作内容','jsnanjing',NULL),(319,279,'partTime','2015-10-29','2016-02-28','2015-10-29 12:57:05','招聘高中英语家教','工作内容：每晚七点到达学生家中，进行高中英语辅导，女大学生优先，有经验的女教师也可。','jsnanjing',NULL),(320,279,'partTime','2015-10-29','2016-02-28','2015-10-29 13:02:12','招聘高中英语家教','每晚七点到家中一对一辅导高中英语','jsnanjing',NULL),(321,279,'partTime','2015-10-29','2016-10-29','2015-10-29 13:06:55','家教晚托班作业辅导兼职','主要负责中小学生晚间辅导','jsnanjing',NULL),(322,284,'partTime','2015-10-29','2016-10-29','2015-10-29 13:24:36','酒店兼职服务员','1：上班时间晚6：00-8:00或8:00-10;00或7:00--9:00或9:00--11:00.可选择一个适合自己的时间段，工作每周至少出勤2次，每次最少做2个小时 (公司另设下午学生兼职专场,下午1:00-6:00,任选其中2-3小时工作)。 \n2：工作内容:买单点单、点送小吃物品、打扫分配区域卫生以及大厅杂务工作 \n3、细心负责,会微笑服务、有亲和力、服从安排、有良好的团队意识! \n4、18周岁---26周岁,男女不限,｛社会人士和学生都可加入｝','jsnanjing',NULL),(323,284,'partTime','2015-10-29','2016-10-29','2015-10-29 13:29:20','红酒店服务员兼职','工作内容','jsnanjing',NULL),(324,284,'partTime','2015-11-29','2016-10-29','2015-10-29 13:30:58','高薪聘兼职保安','具体要求： \n1、身高170cm以上；　　\n2、年龄18--35周岁；　　\n3、身体健康、相貌端正；　　\n4、无犯罪前科、无纹身等； 　　\n5 、有责任心、热爱保安事业。\n 二、招聘岗位：特勤队员\n 性别要求：男　\n招聘人数： 5人　　','jsnanjing',NULL),(325,284,'partTime','2015-10-29','2016-10-29','2015-10-