:44:41','酒店迎宾','岗位职责：\n1、具体负责来宾的迎送服务工作；\n2、负责给客人引座；\n3、替客人指示方向，回答客人问询。\n任职资格：\n1、中专以上学历，身高155CM~170CM左右，形象气质佳,善于沟通；\n2、懂得接待礼仪，有星级以上工作经验者优先。\n工作时间：18:00-23:00，包吃住，面试合格即可上班','jsnanjing',NULL),(513,284,'partTime','2015-10-30','2016-01-31','2015-10-30 11:13:23','高薪 兼职保安','岗位职责:\n1、确实掌握安全事宜,监控室及各指定之警卫岗;\n2、遵行保安经理之指示,服勤安全警卫勤务,确保公司与员工安全。\n任职资格:\n1、18-30岁，男身高170cm以上，女身高160cm以上。身体健康,容貌端正;\n2、熟悉安全制度及安全器材使用、意外事件及紧急事故之预防与安排;','jsnanjing',NULL),(514,284,'partTime','2015-10-30','2016-04-30','2015-10-30 11:16:07','兼职派发传单','岗位职责：1 在学校门口派发单页，要有主动性、有责任心、不怕吃苦. \n2 善于沟通交际、性格开朗、语言表达清晰. 男女不限，大学生兼职亦可！ \n3 工作时间周一至周五下午有1到5小时的发单时间，可灵活安排。\n4 工资12元/小时，做的好加业绩提成，正式打卡日结。','jsnanjing',NULL),(515,284,'partTime','2015-10-30','2016-04-30','2015-10-30 11:18:37','酒店礼仪','岗位职责：1、做好消费宾客的迎、送接待工作，；\n2、了解和收集宾客的建议和意见并及时反馈给上级领导；\n3、以规范的服务礼节，树立公司品牌优质，文雅的服务形象。\n任职资格：1、男女不限，年龄18—45周岁，身体健康，身材匀称、五官端庄，男身高不低于1、65米，女身高不低于1.55米。\n2、具有良好的沟通协调能力及服务意识，反应灵敏，端庄大方、举止文雅；\n3、敬业乐业、具有较强的责任心和吃苦耐劳的职业素养。\n4、工作经验者优先。\n工作时间：面议','jsnanjing',NULL),(516,285,'partTime','2015-10-31','2016-10-31','2015-10-30 11:19:24','高新诚招礼仪模特','工作内容： 礼仪小姐常见的工作有迎宾，引领，站立现场烘托气氛，陪伴和协助主要人员，服侍在场人员，拉彩、捧花、托盘等。迎宾者的任务，是在活动现场负责迎来送往。引领者的任务，是在进行仪式时负责引领主要人员登台和退场。服侍者的任务，是为在场人员提供饮料，安排休息等。拉彩者的任务，是在剪彩时展开、拉直红色缎带。捧花者的任务则在剪彩时手托花团。托盘者的任务，则是为剪彩者提供剪刀、手套等剪彩用品。\n在一般情况下，礼仪小姐指的是迎宾及剪彩礼仪小姐。迎宾者与服务者应不止一人。引导者既可以是一个人，也可以为每位剪彩者各配一名。拉彩者通常应为两人。捧花者的人数则需要视花团的具体数目而定，一般应为一花一人。托盘者可以为一人，亦可以为每位剪彩者各配一人。有时，礼仪小姐亦可身兼数职.\n\n ','jsnanjing',NULL),(517,284,'partTime','2015-10-30','2016-05-31','2015-10-30 11:22:13','菜品推荐话务员 轻松活','岗位职责：纯电话邀约，无销售性质。\n1、根据酒店提供的客户电话，向客户推广酒店的客户服务； \n2、负责接听客户热线，负责客户邀约工作；\n3、通过电话负责客户的约访工作；\n任职资格：\n1、声音甜美，普通话标准，沟通表达能力佳；\n2、熟练操作办公自动化设备及OFFICE软件；\n3、良好的执行力和团队合作精神；\n4、熟悉电话销售或客户服务的业务模式，有电话客服经验者优先。\n','jsnanjing',NULL),(518,284,'partTime','2015-10-30','2016-06-30','2015-10-30 11:24:40','酒店外定送餐员','岗位职责：\n1、负责区域内的快餐盒饭的送达及货款的返回；\n2、执行业务操作流程，准时送达物品，指导客户填写相关资料并及时取回；\n3、整理并呈递相关业务单据和资料；\n4、客户的维护，客户咨询的处理和意见的反馈；\n5、突发事件的处理。\n任职资格：\n1、初中及以上学历；\n2、熟悉当地地形，有同行业工作经验者优先；\n3、吃苦耐劳，人品端正，做事仔细认真；\n4、身体健康，无不良嗜好。\n工作时间：\n早晨10:00-20:00','jsnanjing',NULL),(519,284,'partTime','2015-10-30','2016-05-31','2015-10-30 11:42:00','周末兼职送餐员','岗位职责：\n1、初中及以上文化程度，普通话流利。\n2、年龄18-35岁，会骑电动自行车。\n3、日工作8-9小时，每月有固定休息时间。\n4、公司提供电动车，公司免费提供送餐电动自行车及必要的劳动保护护具。\n5、公司提供基本工资+送餐提成的薪资模式，月薪上不封顶。','jsnanjing',NULL),(520,280,'partTime','2015-09-28','2016-10-31','2015-10-30 11:43:57','招聘上门家教老师','工作内容\n招聘周末上门家教老师，根据你的时间和地址安排家教信息，小学60至80元两个小时，初中70至100元两个小时，高中90至150元两个小时。小班辅导作业3000元一月！','jsnanjing',NULL),(521,291,'partTime','2015-10-30','2015-12-31','2015-10-30 11:44:14','话务员','外呼中心南京移动话务员，主要负责南京移动用户的售后服务和针对用户的满意度做调查回访，根据用户的实际需求推荐用户适合的套餐，避免用户话费不必要的流失。\n','jsnanjing',NULL),(522,291,'partTime','2015-10-30','2015-12-31','2015-10-30 11:44:59','话务员','接听客户来电，给予客户详细耐心的讲解，推荐公司产品从而达成交易\n1.主要负责热线的接听，为顾客解答产品信息；\n2.为打进公司热线的客户提供优质的服务；\n3.促成订单的完成。','jsnanjing',NULL),(523,280,'partTime','2015-10-06','2015-12-31','2015-10-30 11:47:43','兼职托管老师/70元5小时','工作内容:\n教育孩子的学习习惯，行为习惯，主要是督促孩子完成当天的作业\n','jsnanjing',NULL),(524,291,'partTime','2015-10-31','2015-12-31','2015-10-30 11:48:38','收银员','1、要求年龄在40周岁以下；\n2、能吃苦耐劳，有工作经验； \n3、工资2600元/月+奖金；\n4、上班时间17：30-02:30；\n5、提供员工餐（晚餐+宵夜）；\n','jsnanjing',NULL),(525,291,'partTime','2015-10-30','2015-12-31','2015-10-30 11:49:50','收银员','任职资质：有一定的餐饮行业从业经验，电脑熟练，会开发票\n工作时间：每周休息一天，8小时工作制。','jsnanjing',NULL),(526,280,'partTime','2015-10-30','2015-02-01','2015-10-30 11:50:10','兼职促销收银150加提成','工作内容\n1)***促销员：负责各品牌商品的销售 向顾客介绍\n\n2)***理货员：整理货架 货品归类 \n','jsnanjing',NULL),(527,280,'partTime','2015-10-28','2015-12-03','2015-10-30 11:51:59','巧克力促销','工作内容\n负责产品的叫卖，增加销售业绩\n','jsnanjing',NULL),(528,280,'partTime','2015-10-30','2015-11-30','2015-10-30 11:53:54','传单/宣传单页派发员','工作内容\n到小区或者学校等地方发放公司的活动单页进行宣传\n工作时间：上午两个小时，下午四个小时，包餐，工资10元/时，月结。','jsnanjing',NULL),(529,291,'partTime','2015-10-30','2015-12-31','2015-10-30 11:54:34','校园代理','兼职人员限定以下学校南京信息工程大学，滨江学院，金陵学院，成贤学院，南京化工学院，江苏教育学院等校内大学生，主要负责大学生推广，大学生旅游，分期付款，学生贷款。具体面议。','jsnanjing',NULL),(530,291,'partTime','2015-10-30','2015-12-31','2015-10-30 11:56:01','校园代理','1.负责组建管理校园团队，指定校园推广计划活动 ；2.负责执行校园宣传，比如派发传单，签署订单等。 任职要求：1.性格积极进取，勤劳努力，有责任心；2.从事如美团，饿了么等校园项目推广和学生兼职，教育，培训等代理的同学优先考虑；3.有一定的团队管理能力，组织能力，销售能力。','jsnanjing',NULL),(531,284,'partTime','2015-10-30','2016-03-31','2015-10-30 11:56:42','兼职话务员110元一天','主要针对酒店的会员客户推荐酒店的新式菜品，\n并且向其他来过本酒店的客人推荐酒店会员，向其介绍会员的专属权利。','jsnanjing',NULL),(532,291,'partTime','2015-10-30','2015-12-31','2015-10-30 11:57:55','保姆','带孩子 简单的室内卫生','jsnanjing',NULL),(533,291,'partTime','2015-10-30','2015-12-29','2015-10-30 11:59:07','保姆','女性，年龄45岁以下，初中以上文化，五官端正，能吃\n\n苦耐劳。\n\n     月收入：3000元以上','jsnanjing',NULL),(534,280,'partTime','2015-10-31','2016-10-29','2015-10-30 12:00:47','招聘发单员 可以短期或长期兼职','工作内容\n将饭店餐厅新菜肴的优惠券发放\n工作地点:位于地铁附近 交通方便\n薪资:每小时12元 每天工作8小时左右\n任职资格:无需经验 但要不怕吃苦 可以长期兼职\n如能长期兼职 可以申请住宿需求','jsnanjing',NULL),(535,291,'partTime','2015-10-30','2015-12-31','2015-10-30 12:01:06','搬运工','1、负责货物出、入库的装卸和搬运工作；\n2、负责入库货物的摆放，做到合理、整齐；\n3、负责协助送货人员提货作业。\n二.任职资格：\n1、身体健康，吃苦耐劳，服务管理\n三.工作时间待遇：\n每天工作时间10.5小时\n综合工资4000~5000元,交五险一金.\n户口不限,全部为公司正式工，签订正式合同包住,吃饭7元一顿.工作时间10.5小时','jsnanjing',NULL),(536,280,'partTime','2015-10-28','2015-12-22','2015-10-30 12:05:30','商务会所兼职模特（600天）','工作内容\n1.女模公主:身高160以上，形象好\n2.佳丽:身高155以上，时尚大方\n3.男模:身高176以上，400天\n','jsnanjing',NULL),(537,280,'partTime','2015-10-06','2015-12-23','2015-10-30 12:09:16','直招服装模特展示礼仪小姐','工作内容\n:礼仪工作内容有会展礼仪、指引接待、迎宾,领路等, ','jsnanjing',NULL),(538,280,'partTime','2015-10-30','2015-11-30','2015-10-30 12:13:13','实习文员/外贸助理','工作内容\n整理外国客户资料（注意，不是翻译，请找翻译兼职的绕道）','jsnanjing',NULL),(539,280,'partTime','2015-10-13','2015-11-26','2015-10-30 12:16:19','实习生兼职招聘文员','工作内容\nA：熟练使用Word、Excel等办公软件B：因为文职工作，打字速度快，熟悉计算机互联网操作C：有责任心，不浮躁，有条理D：每周白天空余时间不少于四天.，寒假能连续优先，地址在珠江路就近录用。','jsnanjing',NULL),(540,291,'partTime','2015-10-30','2015-12-31','2015-10-30 12:59:06','厨师','1、负责处理厨房的运作及行政事务；\n2、执行店长下达的各项工作任务和工作指示；\n3、负责制订厨房的各种工作计划；\n4、对厨房的出品、质量和食品成本承担重要的责任；\n5、保持对厨房范围的巡视，对下属员工进行督导，及时解决现场发生的问题，帮助下属提高工作能力；\n6、督导厨房各分部主厨对食品原料的管理，使所有食品始终符合标准食谱规定的数量或份量，合理地控制食品成本；\n7、妥善处理客人对出品的投诉；\n8、检查厨房所属各岗位员工的操作规范；\n9、保持对员工队伍特别是厨师以上厨房员工的教育和培训，使之不断提高；','jsnanjing',NULL),(541,291,'partTime','2015-10-30','2015-12-31','2015-10-30 13:00:00','后厨帮手','1. 在领班的领导下，负责所在区域的组织管理工作。并且制定和实施所在辖区员的工作职责。2. 根据预定情况和打荷厨师一起分工协作，确保当天接待任务顺畅进行。3.督导班组人员做好设备的清洁保养、原料收藏保管和厨房的安全卫生工作。4.协助行政总厨负责菜单、产品规格、原料采购规格的制定和新产品的开发工作。5. 对本组的生产进行策划安排，每天提出所需原料的订货和申领要求。并做好成本控制工作.\n任职资格：1. 为人诚实可信，对工作，对事业充满激情。2. 大专以上学历，有不低于3年餐饮行业工作经验。3. 2年以上同等职位中餐厅工作经验。4. 较强的执行力。5. 熟悉所在厨房的业务，热房厨师必须会做冷菜。','jsnanjing',NULL),(542,291,'partTime','2015-10-30','2016-10-30','2015-10-30 13:02:09','理货员','1、配货：按照订单拣货配货\n2、发货：核对配货，无误后打印快递单。\n3、理货：清点货物，按照库房规则摆放上架。\n任职资格 \n1、女性要求18-35岁，高中以上文化\n2、做事习惯一定是要麻利的那种，头脑反应快，而且细心，不易出错。\n3、要有吃苦耐劳的品质\n4，有强烈的团队合作精神。\n5，有相关工作经验的人优先录用。','jsnanjing',NULL),(545,291,'partTime','2015-10-30','2015-11-30','2015-10-30 13:03:33','理货员','负责小件仓库货物的收货，拣配，商品包装，发货，库存盘点，账务处理等作业','jsnanjing',NULL),(546,285,'partTime','2015-10-31','2016-10-31','2015-10-30 13:07:55','三四五星级酒店招聘实习生','工作内容：主要负责点单，传菜，看包房，宴会支台，会场布置。\n酒店免费为兼职人员提供工作服和工作餐，自己配黑色鞋子。\n工作区域：珠江路 新街口 鼓楼 建邺  集庆门大街 大行宫 孝陵卫 江宁 浦口 仙林等地区都有分店 可以根据自己的区域 就近安排上班。\n工作时间：早班：早上7点到中午10点 中班：上午10点到下午4点 晚班：下午5点到晚上10点。可根据自己的时间安排选择其中任何一个或两个班次，两个班次能连起来做的优先安排。\n有意向的可投递简历或电话联系，很高兴为你服务，谢谢。','jsnanjing',NULL),(547,284,'partTime','2015-10-30','2016-02-29','2015-10-30 13:12:26',' 传单派发 酱油活 日结','周末兼职发单要能吃苦，态度认真的学生。\n发单地点在新街口 书店 图书馆 小区等地方\n工资按照 13元一个小时 当天结\n电话前请先短信联系谢谢其他勿扰','jsnanjing',NULL),(548,291,'partTime','2015-10-30','2015-12-31','2015-10-30 13:12:30','保安','1、年龄30-45周岁，身高1.73CM以上，体重68KG以上，体型健壮，五官端正；　　\n2、具有较强的书面表达及组织沟通能力，有亲和力，反应灵敏、应变能力强；　　\n3、2年以上部队或二年以上保安管理相关职业经验；　　\n4、有责任心，能承受较大的工作压力，愿与公司长期共同发展； 　　\n5、无纹身、无不良嗜好，纪律严明，令行禁止；　　\n6、教官或武警退役优先，会擒拿格斗者优先。\n','jsnanjing',NULL),(549,291,'partTime','2015-10-30','2015-12-30','2015-10-30 13:13:23','保安','保安：主要负责巡厂和监控，配有无线对讲机子、制服、警棒、不限时（出入）通行证一张\n押运保安：主要是围绕客户订单为依据随车送货签单拿回执单；随车副驾驶，看好物品不要丢失；跟客户交接，让客户清点货物；不需要搬运。了解生产情况,若无法按时交货尽快与客户沟通。\n','jsnanjing',NULL),(550,285,'partTime','2015-10-31','2015-10-31','2015-10-30 13:13:51','急招钟点工','工作内容：点单，买单，传菜，跑菜之类。\n工作时间自己安排，也可根据酒店安排选择。\n工作区域不固定，但至少一个星期能保证6天左右的班次。\n很高兴为您服务，谢谢。合作愉快。','jsnanjing',NULL),(551,291,'partTime','2015-10-30','2015-12-01','2015-10-30 13:15:02','快递员','1、年龄在40周岁以下。\n2、会骑电动车。对南京市路线熟悉者最佳。\n3、责任心强，能吃苦耐劳,善于思考，灵活应变，发现并能解决问题。\n4、男女不限，工资计件制。','jsnanjing',NULL),(552,284,'partTime','2015-10-30','2016-06-30','2015-10-30 13:15:13','酒店后厨帮工','岗位职责：\n1、负责熬骨头汤、保证食材的新鲜、卫生等；\n2、负责灶台的卫生清理、正常使用。\n任职资格：\n1、年龄40—50岁，性别不限，身体健康；\n2、具有责任心，良好的执行能力和沟通能力，能够严格按照标准操作；\n3、勤奋努力，对餐饮工作有较高的工作热情。\n工作时间：8:00~13:30,15:00到19:00','jsnanjing',NULL),(553,291,'partTime','2015-10-30','2015-12-30','2015-10-30 13:15:46','快递','1、依照公司要求,负责日常收派件工作；\n2、及时回收散单货款和及时回收月结款项，并在规定时间内如数上缴财务入账；\n3、开发客户和进行客户维护工作；\n4、宣传公司相关业务。','jsnanjing',NULL),(554,285,'partTime','2015-10-30','2015-10-31','2015-10-30 13:18:05','高新诚聘话务员','工作内容：：话务员 时间 工作时间：明天开始长期，9:00-12:00，13:30-17:30，18:00-21:00（任选时间段） 工作地点：黎明西路（人民路附近） 工作薪资：12元/小时 工作 要求：口齿清晰，能够灵活应变，有做过移动话务员能够长期做的优先','jsnanjing',NULL),(555,282,'partTime','2015-10-30','2014-04-30','2015-10-30 13:20:34','酒店客房整理员','岗位职责：\n1、按照标准和程序打扫、整理客房，补充客房物品，做好楼层服务工作；\n\n2、检查、保养客房内的设施设备，保持楼面安静及安全，如有异常，向上级报告；\n\n3、快捷、迅速地满足客人提出的合理要求及完成洗衣服务、物品租借等其他服务项目；\n\n4、检查退房，按规范处理宾客遗留物品，及时报告上级和前台；\n\n5、及时反馈客人对酒店的客房及服务方面的意见和建议；\n\n6、完成主管交待的其它工作。\n\n任职资格：\n1、工作认真负责，吃苦耐劳；\n\n2、服务意识强，良好的团队合作精神；\n\n3、身体健康、相貌端正；\n\n4、服从领导安排，一年以上相关工作经验者优先考虑。\n','jsnanjing',NULL),(556,285,'partTime','2015-10-31','2016-10-31','2015-10-30 13:24:51','收银员招聘','工作内容：  1 严格执行顾客服务的原则和个人着装标准  2 为顾客提供快速、准确、微笑、主动、礼貌的顾客服务，回答顾客咨询，主动同顾客打招呼，坚决杜绝一切与顾客争执的事件发生。  3 保持诚实的品质，严格遵守唱收唱付的原则，快速、准确、安全的收取货款，减少现金差异的发生。 4 负责所有商品的消磁工作，并进行防损方面的检查。 5 保证随时有足够的零钞找给顾客。  6 提高扫描的正确率和速度，以提高翻单次数。  7 负责向顾客进行本日特价商品的推销和快讯彩页的发放。  8 就一些自己不能处理的问题求助于收银主管或经理。 9 熟悉收银机、验钞机、消磁机等设备的操作，能解决简单故障，随时整理好小票纸带、购物袋物品的存放等。 10将顾客不要的商品和回收的商品等放在指定地方，等待相关人员集中收取。  11营业结束和开始前，负责收银台区域的清洁卫生和收银台前小货架的理货工作。','jsnanjing',NULL),(557,282,'partTime','2015-10-30','2016-05-31','2015-10-30 13:27:29','西餐厅传菜员 ','岗位职责：\n1、负责餐厅的传菜工作；\n2、完全了解菜品及价格，以便随时为客人服务；\n3、服从管理安排。\n任职资格：\n1、18—25岁，男女不限，\n2、身体健康，反应灵敏，速度快；\n3、踏实肯干，做事认真负责；\n4、服从领导管理，为人友好和善。\n工作时间： 早9：00--12:00，晚3:00--9：00','jsnanjing',NULL),(558,290,'partTime','2015-11-10','2015-11-20','2015-10-30 13:31:46','高薪招聘礼仪模特','体态匀称,上镜感觉好,整体时尚大方,脸部轮廓好。 主要拍摄内容:杂志封面广告、服装广告、画册、饰品广告、护肤品广告等。 1、有舞蹈、模特、体育等形体训练基础者优先； 2、配合平面媒体、网络媒体、新媒体的宣传片拍摄； 3、有一定表现力，配合品牌的广告主题进行拍摄； 4、定期进行公司组织的网拍模特、平面杂志模特、电视广告模特培训以及考核','jsnanjing',NULL),(559,282,'partTime','2015-10-30','2016-04-30','2015-10-30 13:33:06','送餐员','基本要求：\n1、年龄18岁~45岁，仅**，会骑电动车。\n2、基本要求：初中及以上文化水平、会说普通话，具有良好的沟通能力。身体健康、吃苦耐劳，能长期稳定的工作。\n\n3、工作内容：将顾客订购的餐点迅速送达至顾客手中，并按照配送流程完成工作。\n4、薪资：全职：3500--6000；兼职：1800--2200左右。福利好，有保险，公司提供电动车，法定节假日有加班费(3倍工资）。\n\n5、工作时间：全职：8小时；兼职：每天4小时(也可根据自己的空余时间来安排)\n','jsnanjing',NULL),(560,285,'partTime','2015-10-31','2016-10-31','2015-10-30 13:38:49','急招校园兼职','工作内容：.1：负责所在高校的正装业务代理推广工作；  2：向公司总部反馈所在高校的正装市场情况，执行相应的营销策略； 3：配合公司总部在所在高校开展品牌宣传、推广工作；  4：和毕业班、社团、学生机构洽谈正装购买事宜；  5：维护KINGUP金塔正装在所在高校的品牌形象，推广金塔品牌文化。 ','jsnanjing',NULL),(561,290,'partTime','2015-11-10','2016-04-10','2015-10-30 13:40:08','招聘兼职保安工资日结','长期有效 1.急需物业女保安若干(外地 本地 均可),身高162CM以上,20--35岁左右,形象较佳,有工作经验优先。待遇3000--3500左右,做六休一，提供五险，详情面谈。 2.住 工地 保安,主要负责工地的人员及材料的进出管理,夜班巡查等。每月可连休四天,每天12小时连班倒。签正式合同后 队员每月综合工资在3300---4300元左右, 班长每月4000--5000元左右， 队长每月4500--6000元左右，含五险。 退伍军人优先,必须能吃苦耐劳,责任心强, 有工作经验优先录用。有食宿,有加班补贴。有意者,电联。勿投简历 勿投简历 勿投简历 早上8点到晚上10点 电话联系 4.本单位采取综合计算工时工作制,上班十二小时,包住宿,伙食费每天16元从工资中扣除,自由选择休息, 一、本公司新老员工都享有加班费、高温补贴、年终奖等,满勤月工资保底3300元--6000元左右。 2、无犯罪记录,工作认真负责,能吃苦耐劳者优先。 3、退伍军人或有保安经验者优先,工作“”者有提升空间。 4,半年以上的队员有机会参与春节值班有值班补助5000元左右,其他人员节假日均有奖金','jsnanjing',NULL),(562,295,'partTime','2015-10-30','2016-06-30','2015-10-30 13:40:10','酒店兼职服务员 ','1、按照领班安排认真做好桌椅、餐…2、接待顾客应主动、热情、礼貌、耐心、周到，使顾客有宾至如归之感；\n3、运用礼貌语言，为客人提供最佳服务，\n4、善于向顾客介绍和推销本餐厅饮品及特色菜点；\n5、配合领班工作，服从领班或以上领导指挥，团结及善于帮助同事工作；\n6、积极参加培训，不断提高服务技能。\n可根据居住地点就近安排工作','jsnanjing',NULL),(563,295,'partTime','2015-10-30','2016-04-30','2015-10-30 13:43:21','酒店服务员 日结','适合人群:\n1.上班族（上一休一或周末）\n2.在校大学生（周末，课余时间或寒暑假）\n3.节假日或待业\n不规定一周上几天班，只要有空余时间都可以兼职，时间自由。\n工作内容:\n1、宴会厅：男生负责摆放桌椅，布置舞台或演讲席。女生负责摆放矿泉水及鲜花、纸笔等（大型会议及结婚典礼、公司周年庆典、新闻发布会等）用人量较大。 \n\n注：会场布置长期招人。工作期间免费提供住宿与工作餐 \n\n2、西餐厅（自助式西餐）：负责撤餐具摆餐具及擦红酒杯刀叉等 \n\n3、中餐厅：餐前摆放餐具，餐中上菜、餐后收拾餐具归类餐具和包间协助正式工服务及传菜。 \n4.客房部:协助正式员工打扫房间。\n','jsnanjing',NULL),(564,285,'partTime','2015-10-31','2015-10-31','2015-10-30 13:48:16','招聘保姆','工作内容：1.按照家长要求照料XXX、XXX的日常生活。     \n          2. 负责做饭（早、中、晚三餐）。  \n          3.负责打扫家庭卫生。','jsnanjing',NULL),(565,285,'partTime','2015-10-31','2015-10-31','2015-10-30 13:59:39','杂工急招','工作内容：1.上班前整理好仪容仪表，保持良好的精神状态，按时参加班会等。\n          2.随时保持干净卫生。\n          3.定时清扫地面菜叶，保持清洁卫生。\n          4.做好蔬菜的保鲜工作。','jsnanjing',NULL),(566,295,'partTime','2015-10-30','2016-06-30','2015-10-30 14:04:41','传单派发员 当天日结','派发传单\n前2天需要到店里来简单学习一下基础知识。\n工作时间：早八点到下午五点，中午休息一个小时。\n记录客户，如定一个客户奖励20元','jsnanjing',NULL),(567,285,'partTime','2015-10-31','2015-10-31','2015-10-30 14:05:20','星级酒店招聘厨师','工作内容：.1.每天炒菜，研究菜品，开餐前的菜品准备\n            2.有自己独特的特色菜的技巧\n            3.根客人的的交际能力也要强。','jsnanjing',NULL),(568,288,'partTime','2015-11-05','2015-12-15','2015-10-30 14:06:42','高薪诚聘勤杂工人','勤杂工：\n岗位职责：\n1、负责工厂日常勤务：打扫卫生、搬运、打包等杂务；\n2、根据表现及公司需要，有被培养转岗的机会成为熨烫工、车工等其它职务；\n3、负责执行公司安排的其它事宜。\n\n任职要求：\n1、男，年龄在18-30岁之间，初中以上学历，热爱服装行业；\n2、吃苦耐劳，热爱学习，对工作认真负责，能承受较大的工作压力；\n3、个性乐观开朗，有培养潜质；\n4、如有服装相关工作经验者佳。','jsnanjing',NULL),(569,288,'partTime','2015-11-10','2015-12-30','2015-10-30 14:09:32','招聘顺丰速递收银员','1、接待顾客的咨询，了解顾客的需求并达成销售；\n2、负责做好货品销售记录、盘点、账目核对等工作，按规定完成各项销售统计工作\n3、做好所负责区域的卫生清洁工作；\n5、完成上级领导交办的其他任务。\n任职资格：\n1、高中以上学历；\n2、有相关工作经验者优先；\n3、具有较强的沟通能力及服务意识，吃苦耐劳；\n4、年龄28-38岁，身体健康。\n工作时间：一周休一','jsnanjing',NULL),(570,280,'partTime','2015-10-30','2015-12-31','2015-10-30 14:10:51','招聘中西餐厅服务员可长期兼职','工作内容\n传菜 端菜,收拾餐桌,擦餐具杯子、男生要搬桌椅等等散杂活。 \n\n对兼职人员要求不高 来上班尽量自己穿黑鞋子来就可以了。\n','jsnanjing',NULL),(571,285,'partTime','2015-10-31','2015-10-31','2015-10-30 14:12:09','招聘理货员','工作内容：1.订货工作，对自己所负责的商品有一定订货能力。\n          2.随时检查自己负责的商品，当发现商品库存到一定订货的标准时，应当立即报告给主管订货，\n          3.做好收货验货工作。','jsnanjing',NULL),(572,288,'partTime','2015-11-10','2015-12-10','2015-10-30 14:12:17','诚招理货员可日结','岗位职责：\n1、熟悉所在商品部门的商品名称、产地、厂家、规格、用途、性能、保质期限；\n2、遵守超市仓库管理和商品发货的有关规定，按作业流程进行该项工作；\n3、掌握商品标价的知识，正确标好价格；\n4、熟练掌握商品陈列的有关专业知识，并把它运用到实际工作中；\n5、搞好货架与责任区的卫生，保证清洁；\n6、对顾客挑选后、货架剩余商品进行清理并作好商品的补充工作。','jsnanjing',NULL),(573,280,'partTime','2015-10-28','2015-12-08','2015-10-30 14:12:52','饭店直招服务员包吃住不收服装费','工作内容\n男女不限，有餐饮服务行业工作经验优先考虑，工作认真，负责，手脚勤快\n工作时间：一天两班至，可进行排班，能长期稳定优先考虑，一周提供2-3天能最少做一个月的也可以，可根据你的空余时间排班','jsnanjing',NULL),(574,288,'partTime','2015-11-01','2015-12-30','2015-10-30 14:14:51','诚聘物流快递员','1、学历要求：初中及以上学历 ，基本的字母要熟悉识别。\n2、年龄要求：18-55周岁，能吃苦耐劳，不晕车能够适应出差，有较好的服务意识。\n3、其他要求：男女不限，身高适中，身体健康，头脑灵活，吃苦耐劳。\n\n工作内容：\n1、主要是围绕客户订单为依据跟车送货签单拿回执单。跟随车子，看好物品不要丢失。跟客户交接，让客户清点货物，\n2、不需要搬运。跟踪生产情况,若无法按时交货尽快与客户沟通。','jsnanjing',NULL),(575,280,'partTime','2015-10-20','2015-11-30','2015-10-30 14:16:05','招聘小时工/钟点工','工作内容\n电话营销','jsnanjing',NULL),(576,288,'partTime','2015-11-01','2015-12-30','2015-10-30 14:17:04','招聘煮饭阿姨','每周工作六天，每天只煮中餐，每餐约30-45人用餐；菜品基本都是批量采购，青菜和小配菜、配料需每天购买，有意者谈，需持健康证。','jsnanjing',NULL),(577,280,'partTime','2015-10-20','2015-12-05','2015-10-30 14:17:52','诚聘钟点工服务员学生兼职工资日结','工作内容\n1、自觉遵守公司内的各项规章制度,工作安排; \n2、按要求做好责任区内、餐台、吧台的环境卫生; \n3、熟知公司内提供的饮品及特点; \n','jsnanjing',NULL),(578,280,'partTime','2015-10-29','2015-12-22','2015-10-30 14:19:47','诚招话务员20每小时','工作内容\n每天工作时间13-18点，五小时，主要工作打电话发短信，回访','jsnanjing',NULL),(579,280,'partTime','2015-10-26','2015-10-31','2015-10-30 14:23:08','招聘糖酒会保安','工作内容\n负责维持活动现场的秩序，控制人员流量','jsnanjing',NULL),(580,295,'partTime','2015-10-30','2016-07-31','2015-10-30 14:23:43','人偶服传单派发员','任职资格：\n工作努力认真，不放鸽子，穿着人偶服吸引人流，将本公司的宣传单页派发的目标客户手上。','jsnanjing',NULL),(581,285,'partTime','2015-10-31','2015-10-31','2015-10-30 14:25:12','五星级酒店招聘保安','工作内容：1.着装整齐，按规定上岗交接-班，忠于职守，在岗时不得与其他无关人员聊天。\n\n          2.负责外来人员和外来车辆的检查，严格按规定登记。对不符合要求进入小区的人员和车辆进行礼貌劝阻，对可疑情况提高警惕，及时报告转载自百分网http://www.oh100.com，请保留此标记，确保安全。\n\n         3.严禁收买、推销、小贩等闲杂人员进入小区内，不准装修队擅自进入小区自找“生意”。\n\n         4.禁止2.5吨以上货车进入小区，严禁危险品进入小区。\n\n         5.完成上级交办的其它工作。\n\n\n','jsnanjing',NULL),(582,280,'partTime','2015-09-29','2016-10-30','2015-10-30 14:25:36','招聘兼职快递员此信息长期有效','工作内容\n一单6元，多劳多得，已有兼职人员月薪过万了','jsnanjing',NULL),(583,280,'partTime','2015-09-28','2015-10-28','2015-10-30 14:27:35','招聘兼职快递员分拣员','工作内容:负责快递的分拣工作','jsnanjing',NULL),(584,288,'partTime','2015-11-01','2015-12-01','2015-10-30 14:29:20','诚招顺丰速递校园发货员','负责校园快递分拣接收，负责快递发货','jsnanjing',NULL),(585,282,'partTime','2015-10-30','2016-10-31','2015-10-30 14:30:17','优秀实习生','任职资格：\n1.电子商务、市场营销、计算机等专业优先考虑；\n2.对移动互联网及金融行业有一定的兴趣，比较关注；\n3.有一定的沟通，交际及逻辑思维能力；\n4.可以参与公司的各项项目的开发及运作中；\n5.此岗位是营销与商务的结合，既需要开发能力也需要谈判能力。\n福利待遇：\n岗前培训+五险一金+基本工资+项目提成+节日生日补贴+话补\n职业晋升通道：试用商务代表——高级商务代表——大客户代表——高级大客户代表——资深大客户代表——试用商务经理——正式商务经理——高级商务经理——商务总监\n有平台才有成就自己的机会，希望广大应届生朋友不要错过。','jsnanjing',NULL),(586,292,'partTime','2015-10-30','2015-12-30','2015-10-30 14:31:48','家教','涵盖领域：小学，初中，高中各科\n家教时间：由家长和孩子拟定，我们会协调好\n家教方式：一对一上门家教\n参考价格：小学30元／小时，初中45元／小时，高中60元／小时\n           （具体价格可随具体情况商议）','jsnanjing',NULL),(587,285,'partTime','2015-10-31','2015-10-30','2015-10-30 14:31:52','诚聘快递员','工作内容：1、依照公司要求,负责日常收件、送件工作；\n　　2、负责客户快件不受损失，确保公司利益不受侵害，指导客户填写相关资料并及时取回；\n　　3、整理并呈递相关业务单据和资料；\n　　4、客户的维护，客户咨询的处理和意见的反馈；\n　　5、领导交办的其他工作。\n','jsnanjing',NULL),(588,282,'partTime','2015-10-30','2016-04-30','2015-10-30 14:32:13','业务实习生+无责任底薪','工作，不是一种可有可无，它是我们一生的依靠。青春是挽不回的水，转眼消失在指尖，用力的浪费，再用力的后悔, 不要沉溺于过去, 接受新的生活, 新的自己, 新的团队。 在这里，你能收获的不仅仅是高薪，还有发展、技能、财富、知识和家人！收拾行李，寻找新的自己，加入我们吧！只有你想不到的没有你做不到的！即刻起，点赞你的生活，从这一份工作开始！ 岗位职责: 1、在主管的带领、培训下负责市场开拓、传播公司品牌及产品知识、完成销售工作。 2、维护好公司的形象，保障客户的消费体验。 3、发展新客户,管理维护客户关系,增加产品销售范围。 任职资格： 1、18-25岁，男女不限，富有激情、热爱销售、语言表达能力强、善于沟通、勤奋上进、能吃苦耐劳。 2、有上进心，不甘平庸，喜欢挑战自己。 3、敬业精神强、对工作有极强的责任心。有较强的团队合作意识，并且有一定的市场拓展能力。 薪资福利待遇： 1、无责底薪+高提成+高奖金+年终分红+医疗保险+集团基金+旅游度假奖=3500—8000元 2、公司免费为所有新员工提供系统、专业、一带一的跟踪培训。 3、提供公费旅游，不定期组织员工活动，生日享受神秘礼物。 4、提供完善、公平公正的职业发展平台与的晋升空间。 5、一经录用，公司提供免费公寓式住宿。 有意向者可在下午两点钟直接到公司或电话预约参加面试！ 这是年轻人的世界，期待你的加入！','jsnanjing',NULL),(589,292,'partTime','2015-10-30','2015-12-31','2015-10-30 14:32:54','一对一家教','1、一对一计时家教：适合平时课业比较紧张、成绩较好问题不多的学生，可以安排在周末或者平时晚上，对薄弱点进行针对性的补习和强化提高。\n2、一对一陪读家教：适合家长工作忙无暇顾及学生课业、学生基础薄弱、学习习惯不好、需要进行全面辅导的学生，可以在周一至周五或者隔天进行一次辅导，全面补习、培养习惯、提高成绩。\n3、一对一住家式家教：适合郊区或者县级市的学生。鉴于交通因素，老师需要住宿在学生家里。该类型家教优势：家教时间可以自由掌握，同时家教老师良好的学习和生活习惯可以传递给学生，学生和老师能够在一种比较友好的氛围下进行学习和交流。\n4、家长团课。所谓“团课”，即家长可以和熟悉的亲朋商量好，把几家的孩子凑到一起上课，价格更实惠，可以花小学家教的钱，请初中的家教，花初中家教的钱，请高中家教。','jsnanjing',NULL),(591,282,'partTime','2015-10-30','2016-04-30','2015-10-30 14:34:35','高薪聘请家庭保姆','岗位职责：\n1、负责所分配客户的家庭卫生清洁工作；\n2、负责家庭用餐的食材采购、做饭等工作；\n3、负责照顾好小孩的饮食起居、学校接送等事项；\n4、听从分配和安排。\n任职资格：\n1、女，身体健康，年龄20-45岁；\n2、有相关工作经验者优先考虑。','jsnanjing',NULL),(592,292,'partTime','2015-10-30','2015-12-31','2015-10-30 14:34:39','发传单','发传单，贴传单','jsnanjing',NULL),(593,288,'partTime','2015-11-01','2015-12-01','2015-10-30 14:34:47','诚招食堂厨师','1、三星级以上酒店同岗位工作2年以上工作经历；\n\n2、热爱餐饮行业，具有一定的创新意识；\n\n3、有团队合作意识，服从领导的安排。','jsnanjing',NULL),(594,292,'partTime','2015-10-30','2015-12-30','2015-10-30 14:35:54','发传单','在展会固定地点上发传单，工作轻松，要求男女皆可，体貌端正，有责任心，工资当天结算','jsnanjing',NULL),(595,282,'partTime','2015-10-30','2016-05-31','2015-10-30 14:36:41','售后话务员','岗位职责：\n1、了解客户服务需求信息，进行有效跟踪，做好售前、售后指导和服务工作； \n1、熟练运用公司产品，解答客户提问并落实问题； \n3、与相关部门紧密配合，协调沟通；\n4、维护客户关系，并开发新客户\n任职资格：\n1、具备敏锐的商业意识，较强的应变能力、口头表达与沟通能力；\n3、有较强的推广和维护协调客户的能力，熟悉客户服务流程；\n4、具备较强的学习能力，可快速掌握专业知识，及时开展工作；\n5、熟练运用office及良好的文档写作能力；\n6、工作严谨，计划性强，善于分析思考问题，有责任心；工作时间：','jsnanjing',NULL),(596,288,'partTime','2015-11-01','2015-12-30','2015-10-30 14:38:42','招聘家庭教师','诚聘中小学各科家教兼职老师，要求有责任心，有经验者​‌‌待遇从优','jsnanjing',NULL),(597,282,'partTime','2015-10-31','2016-05-31','2015-10-30 14:39:03','写字楼兼职话务员','招聘话务员，女性，话语清晰，普通话标准，在校大学生可兼职，工作环境写字楼内，有茶水间休息室。\n交通方便，有意者可长期兼职，工作优秀者有相应奖励，正常周一至周五每天工作3小时，工作时间可进行商讨，也可自由安排。\n时薪13元1小时。','jsnanjing',NULL),(598,282,'partTime','2015-10-30','2016-07-31','2015-10-30 14:41:13','校园兼职/助理','职责概述：\n1、本职位为校园兼职招聘，可以接受在校大学生，专业为公司视频互动项目在校园等范围内招募专兼职在线娱乐主播、游戏主播、跳舞主播。\n2、周末也可以兼职在商业聚集区、地铁出入口、商场、写字楼寻猎一些高颜值专兼职线上主播培养对象，有保底并按招募到人头提取提成。\n3、也可以通过网络每天线上在各大视频互动平台挖掘一些可培养在线主播。\n4、本职位首批仅招3名，男女不限，有业绩要求，在校资源广泛可以优先。\n\n职位要求：\n1、面像亲善、沟通能力强、诚实守信。\n2、有团队意识和职业操守，对待工作计划性、目的性强。\n工作时间：自行安排','jsnanjing',NULL),(599,292,'partTime','2015-10-30','2015-12-31','2015-10-30 14:41:28','实习生','1、负责前台电话接听、转