锻炼自我的机会。每月的收入可以达到2000左右。如果做得好，还可以更高。','jsnanjing',NULL),(686,288,'partTime','2015-11-01','2015-12-30','2015-10-30 15:49:22','高薪诚聘快递员','1、负责区域内的物品送达及货款的及时返回；\n2、执行业务操作流程，准时送达物品，指导客户填写相关资料并及时取回；\n3、整理并呈递相关业务单据和资料；\n4、客户的维护，客户咨询的处理和意见的反馈；\n5、突发事件的处理。','jsnanjing',NULL),(687,288,'partTime','2015-11-01','2015-12-30','2015-10-30 15:51:56','高底薪+管吃住诚聘杂工','岗位职责:\n1.能独立加工和制作各种菜肴,喜欢创新,有经 验者优先。\n2.能够熟练家常菜的制作.\n3.热爱餐饮行业,吃苦耐劳,踏实肯干.\n4.三年以上本岗位工作经验.\n\n任职资格:1.热爱餐饮行业,吃苦耐劳,踏实肯干.\n2.身体健康,无重大疾病. 年龄18--40周岁\n3.团结同事,服从领导安排','jsnanjing',NULL),(688,288,'partTime','2015-11-01','2016-03-01','2015-10-30 15:53:55','分拣员4千工作自由包食宿','岗位职责：\n1、熟悉所在商品部门的商品名称、产地、厂家、规格、用途、性能、保质期限；\n2、遵守超市仓库管理和商品发货的有关规定，按作业流程进行该项工作；\n3、掌握商品标价的知识，正确标好价格；\n4、熟练掌握商品陈列的有关专业知识，并把它运用到实际工作中；\n5、搞好货架与责任区的卫生，保证清洁；\n6、对顾客挑选后、货架剩余商品进行清理并作好商品的补充工作。\n任职资格：\n1、18-55周岁，男女不限；\n2、有无经验均可，有大型商场或超市工作经验者优先；\n3、热爱零售行业，吃苦耐劳，责任心强，身体健康；','jsnanjing',NULL),(689,288,'partTime','2015-11-01','2015-12-30','2015-10-30 15:55:36','招聘保安员','具体要求：　　\n1、年龄30-45周岁，身高1.73CM以上，体重68KG以上，体型健壮，五官端正；　　\n2、具有较强的书面表达及组织沟通能力，有亲和力，反应灵敏、应变能力强；　　\n3、2年以上部队或二年以上保安管理相关职业经验；　　\n4、有责任心，能承受较大的工作压力，愿与公司长期共同发展； 　　\n5、无纹身、无不良嗜好，纪律严明，令行禁止；　　\n6、教官或武警退役优先，会擒拿格斗者优先。','jsnanjing',NULL),(1271,3427,'partTime','2015-10-31','2015-10-31','2015-10-31 01:07:39','保洁','打扫卫生','jsnanjing',NULL),(1272,3427,'partTime','2015-10-31','2015-10-31','2015-10-31 01:08:08','保洁','卫生','jsnanjing',NULL),(1339,281,'partTime','2015-11-06','2015-12-06','2015-11-06 14:52:42','仙林新地酒店服务员','做宴会服务员，传菜等','jsnanjing',NULL),(1340,281,'partTime','2015-11-13','2015-12-14','2015-11-14 18:40:23','新地晚班','工作内容服务员','jsnanjing',NULL),(1360,298,'partTime','2015-12-01','2015-12-05','2015-12-01 16:02:21','万达同情','服务员','jsnanjing',NULL),(1361,298,'partTime','2015-12-01','2015-12-10','2015-12-01 16:06:57','万达同庆（20151201）','服务员','jsnanjing',NULL),(1381,298,'partTime','2015-12-02','2015-12-03','2015-12-02 17:03:56','万达同庆','工作内容服务员','jsnanjing',NULL),(1382,4223,'partTime','2015-12-02','2015-12-05','2015-12-02 21:00:23','新地晚班201512