/*Table structure for table `prod_order_flow` */

DROP TABLE IF EXISTS `prod_order_flow`;

CREATE TABLE `prod_order_flow` (
  `FLOW_ID` bigint(20) NOT NULL,
  `PROD_TYPE` varchar(20) DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL,
  PRIMARY KEY (`FLOW_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='产品订单流程';

/*Data for the table `prod_order_flow` */

/*Table structure for table `prod_order_flow_node` */

DROP TABLE IF EXISTS `prod_order_flow_node`;

CREATE TABLE `prod_order_flow_node` (
  `FLOW_NODE_ID` bigint(20) NOT NULL,
  `FLOW_ID` bigint(20) DEFAULT NULL,
  `ORIGIN_STATE` varchar(20) DEFAULT NULL,
  `ORDER_ITEM_TYPE` varchar(20) DEFAULT NULL COMMENT 'cancel取消\n            payment付款成功\n            complete完成\n            booking预约\n            signin签到\n            siginout签退\n            pointsend积分发放\n            rebate余额返还，返利\n            charge扣除佣金\n            refund退款',
  `DEST_STATE` varchar(20) DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL,
  PRIMARY KEY (`FLOW_NODE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='流程节点';

/*Data for the table `prod_order_flow_node` */

/*Table structure for table `prod_price` */

DROP TABLE IF EXISTS `prod_price`;

CREATE TABLE `prod_price` (
  `PRICE_ID` bigint(20) NOT NULL,
  `PROD_ID` bigint(20) DEFAULT NULL,
  `VALUE` float DEFAULT NULL,
  `VALUE_TYPE` varchar(20) DEFAULT NULL,
  `EFF_DATE` date DEFAULT NULL,
  `EXP_DATE` date DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL,
  PRIMARY KEY (`PRICE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='产品定价';

/*Data for the table `prod_price` */

/*Table structure for table `sys_param` */

DROP TABLE IF EXISTS `sys_param`;

CREATE TABLE `sys_param` (
  `PARAM_CLASS` varchar(256) DEFAULT NULL,
  `PARAM_VALUE` varchar(256) DEFAULT NULL,
  `PARAM_NAME` varchar(256) DEFAULT NULL,
  `SEQ` smallint(6) DEFAULT NULL,
  `TABLE_COLUMN` varchar(256) DEFAULT NULL COMMENT '使用此参数的表字段',
  `SUPER_CLASS` char(10) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统参数定义';

/*Data for the table `sys_param` */

/*Table structure for table `sys_seq` */

DROP TABLE IF EXISTS `sys_seq`;

CREATE TABLE `sys_seq` (
  `SEQ_NAME` varchar(128) NOT NULL,
  `START_BY` bigint(20) DEFAULT NULL,
  `INCREMENT_BY` smallint(6) DEFAULT NULL,
  `LAST_NUMBER` bigint(20) DEFAULT NULL,
  `JVM_STEP_BY` bigint(6) DEFAULT NULL,
  `TAB_NAME` varchar(128) DEFAULT NULL,
  `COL_NAME` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`SEQ_NAME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='seq定义表';

