96,288,6,'',NULL),(897,288,8,'150',NULL),(898,288,9,'overnight',NULL),(899,288,28,'江宁淳化顺丰中转场',NULL),(900,288,51,'袁先生',NULL),(901,289,10,'南京馨乐企业管理咨询有限公司',NULL),(902,289,3,'3252642950@qq.com',NULL),(903,289,4,'南京市浦口区 大桥北路1号 华侨银座A座 13楼',NULL),(904,289,6,'',NULL),(905,289,8,'150',NULL),(906,289,9,'qita',NULL),(907,289,28,'南京馨乐企业管理咨询有限公司于2015年成立，目前本公司业务范围主要是企业管理咨询、市场营销策划、展览展示服务、会务服务、多媒体设计、制作、代理及发布国内各类广告业务',NULL),(908,289,51,'袁先生',NULL),(909,290,10,'乐尚地产',NULL),(910,290,3,'3252642950@qq.com',NULL),(911,290,4,'南京市建邺区白龙江东街74号乐尚地产',NULL),(912,290,6,'',NULL),(913,290,8,'150',NULL),(914,290,9,'overnight',NULL),(915,290,28,'我们拥有一个高度认同企业核心价值观！我们一直坚信人是企业最重要的财富，是企业发展的源动力，我们始终把培养南京本土的房地产二、三级市场的精英团队当作最重要的事去做。期待你的加入！成就我们共同的梦想',NULL),(916,290,51,'袁先生',NULL),(917,295,10,'南京行风文化传媒有限公司',NULL),(918,295,3,'  ',NULL),(919,295,4,'南京市鼓楼区',NULL),(920,295,6,'  ',NULL),(921,295,8,'150',NULL),(922,295,9,'overnight',NULL),(923,295,28,'   ',NULL),(924,295,51,'王小姐',NULL),(925,281,10,'南京志远企业管理有限公司',NULL),(926,281,3,'41563899@qq.com',NULL),(927,281,4,'南京市富贵山25号 ',NULL),(928,281,6,'',NULL),(929,281,8,'150',NULL),(930,281,9,'overnight',NULL),(931,281,28,'南京志远企业管理有限公司是一家战略管理型集团公司，集团公司上下注册资本金约1.3亿元人民币。公司实行总部负责集团的财务、资产运营和集团整体的战略规划，推行“无边界企业文化”的品牌管理管控模式。公司在制定集团业务战略的基础上，积极建立良好的治理结构和内控制度，确立部门职责，并在人力资源管理体系的配合下，按照高效的工作流程，来最终实现集团目标，力求以资源共享、优势互补、提高创新能力和综合竞争能力的完美结合实现企业价值最大化。',NULL),(932,281,51,'刘经理',NULL),(933,286,10,'南京喜登来酒店管理有限公司',NULL),(934,286,3,'   ',NULL),(935,286,4,'南京市珠江路',NULL),(936,286,6,'   ',NULL),(937,286,8,'express',NULL),(938,286,9,'qita',NULL),(939,286,28,'折叠 现状酒店业迅猛发展也为本土酒店管理公司的产生和发展提供了市场空间。一方面，中低档酒店市场扩展迅猛，但管理模式的发展严重滞后，企业需要科学规范管理的需求日益迫切;另一方面，中低档单体酒店大多无力承受国外酒店管理公司的高费用，而国外酒店管理公司的目标市场集中定位于高档酒店。这些情况都导致了针对中低档酒店管理产品的巨大需求空间。一些本土酒店管理公司在吸收国外先进管理产品的基础上融合中国实践经验逐步建立起了自己的管理模式，逐渐在中低档酒店市场开辟出了自己的天地。\n\n与此同时，旅游和商务出行市场的进一步扩大，带动了酒店业的大发展，酒店管理产品的买方市场更为开阔;虽然高档酒店市场继续被国外酒店管理公司掌控，但是在中低档酒店市场中，本土化酒店管理公司得到了迅速的发展，并出现了百花齐放的状况。随着市场的细分，酒店管理公司也随之产生了进一步的细分。如以国内旅游者为主要目标客户的低端经济型酒店市场，由于市场规模大、需求稳定，在非典过后更是呈现了迅猛的发展态势。典型的低端酒店酒店管理公司如\"锦江之星\"、\"尚客优\"、\"如家\"、\"汉庭\"、7天等。在以商务及家庭出游者为主要目标客户的中档酒店市场，以\"星程\"\"和颐\"\"骏怡城际酒店\"为代表的后起之秀也迅速发展，开始在竞争愈加激烈的酒店管理市场分一杯羹。\n',NULL),(940,286,51,'林小姐',NULL),(948,3427,3,'',NULL),(949,3427,6,'',NULL),(950,3427,28,'test',NULL),(1278,278,1,'278','2015-10-28 21:09:45'),(1279,279,1,'13951834158','2015-10-28 21:09:45'),(1280,280,1,'280','2015-10-28 21:09:45'),(1281,281,1,'281','2015-10-28 21:09:45'),(1282,282,1,'282','2015-10-28 21:09:45'),(1283,283,1,'283','2015-10-28 21:09:45'),(1284,284,1,'284','2015-10-28 21:09:45'),(1285,285,1,'285','2015-10-28 21:09:45'),(1286,286,1,'286','2015-10-28 21:09:45'),(1287,287,1,'287','2015-10-28 21:09:45'),(1288,288,1,'288','2015-10-28 21:09:45'),(1289,289,1,'289','2015-10-28 21:09:45'),(1290,290,1,'290','2015-10-28 21:09:45'),(1291,291,1,'18672516726','2015-10-28 21:09:45'),(1292,292,1,'292','2015-10-28 21:09:45'),(1293,293,1,'293','2015-10-28 21:09:45'),(1294,294,1,'294','2015-10-28 21:09:45'),(1295,295,1,'295','2015-10-28 21:09:45'),(1297,297,1,'297','2015-10-28 21:09:45'),(1298,298,1,'298','2015-10-28 21:09:45'),(1299,299,1,'299','2015-10-28 21:09:45'),(1542,3427,66,'46979074',NULL),(1563,3363,66,'46979074',NULL),(1622,4191,10,'金融督导','2015-11-01 20:14:00'),(1623,4191,1,'18352528739','2015-11-01 20:14:00'),(1624,4191,54,'','2015-11-01 20:14:00'),(1625,4191,61,'private','2015-11-01 20:14:00'),(1643,280,66,'2646116652',NULL),(1665,1,10,'系统管理员','2015-11-03 16:50:06'),(1666,1,1,'admin','2015-11-03 16:50:06'),(1667,1,4,'江苏南京','2015-11-03 16:50:06'),(1668,1,8,'150','2015-11-03 16:50:06'),(1669,1,9,'qita','2015-11-03 16:50:06'),(1670,1,51,'黄','2015-11-03 16:50:06'),(1671,1,3,'','2015-11-03 16:50:06'),(1672,1,6,'','2015-11-03 16:50:06'),(1673,1,28,'从事企业信息化建设与咨询业务','2015-11-03 16:50:06'),(1674,1,66,'','2015-11-03 16:50:06'),(1675,4223,10,'刘慕言','2015-11-06 14:57:37'),(1676,4223,1,'18761686577','2015-11-06 14:57:37'),(1677,4223,54,'18761686577','2015-11-06 14:57:37'),(1678,4223,61,'private','2015-11-06 14:57:37'),(1679,4223,2,'male','2015-11-06 14:57:37'),