/* Function  structure for function  `currval` */

/*!50003 DROP FUNCTION IF EXISTS `currval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `currval`(seqname VARCHAR(50)) RETURNS int(11)
BEGIN    
  DECLARE current INTEGER;    
  SET current = 0;    
  SELECT LAST_NUMBER INTO current    
  FROM sys_seq    
  WHERE seq_name = seqname limit 1;    
  RETURN current;    
END */$$
DELIMITER ;

/* Function  structure for function  `nextval` */

/*!50003 DROP FUNCTION IF EXISTS `nextval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `nextval`(seq_name VARCHAR(50)) RETURNS int(11)
BEGIN    
   UPDATE sys_seq    
   SET last_number = last_number + 1    
   WHERE seq_name = seq_name;    
   RETURN currval(seq_name);    
END */$$
DELIMITER ;

